import React from "react";
import styled from "styled-components";
import { PostType } from "../App";

type PostProps = PostType;

const PostElementFooterStyle = styled.section`
    display: block;
    margin: 0px;
    background-color: #f5f5f5;
    border-top: #dcedc8 solid 1px;
    min-height: 10vh;
`;

const PostElementContentStyle = styled.section`
    padding: 5px;
`;

const Post: React.ComponentType<PostProps> = ({ userId, title, body }) => {
    return (
        <li>
            <div className="post-element">
                <h4>Autor: {userId}</h4>
                <h3>
                    <b>{title}</b>
                </h3>
                <PostElementContentStyle>{body}</PostElementContentStyle>
                <PostElementFooterStyle></PostElementFooterStyle>
            </div>
        </li>
    );
};

export default Post;
